import Navbar from "./components/Navbar.jsx"
import './App.css';

import { ThemeProvider } from 'styled-components';
import { lightTheme, darkTheme } from './themes/theme.js';
import { GlobalStyles } from './themes/global.js';

import React, { useState } from 'react';

function App() {

  const [darkMode, setDarkMode] = useState(true);

  return (
    <ThemeProvider theme={darkMode ? darkTheme : lightTheme}>
      <>
        <GlobalStyles />
        <Navbar themeSwitch={setDarkMode} theme={darkMode}/>
        <div className="bg-image">
          <img
            src="https://mdbcdn.b-cdn.net/img/new/standard/city/053.jpg"
            class="w-50"
            alt="Sample"
          />
          <div class="mask mask-custom">
            <div class="d-flex justify-content-center align-items-center h-100">
              <h3 class="text-white mb-0">Can you see me?</h3>
            </div>
          </div>
        </div>
      </>
    </ThemeProvider>
  );
}

export default App;
